/**
 * @file
 * Example 023: ID Verification authentication
 * @author DocuSign
 */

const path = require('path')
    , docusign = require('docusign-esign')
    , validator = require('validator')
    , dsConfig = require('../../config/index.js').config
    ;

const eg023IdvAuthentication = exports
    , eg = 'eg023' // This example reference.
    , mustAuthenticate = '/ds/mustAuthenticate'
    , minimumBufferMin = 3
    ;

/**
 * Create the envelope
 * @param {object} req Request obj
 * @param {object} res Response obj
 */
eg023IdvAuthentication.createController = async (req, res) => {
    // Step 1: Obtain your OAuth token
    // At this point we should have a good token. But we
    // double-check here to enable a better UX to the user.
    let tokenOK = req.dsAuth.checkToken(minimumBufferMin);
    if (! tokenOK) {
        req.flash('info', 'Sorry, you need to re-authenticate.');
        // We could store the parameters of the requested operation so it could be
        // restarted automatically. But since it should be rare to have a token issue
        // here, we'll make the user re-enter the form data after authentication.
        req.dsAuth.setEg(req, eg);
        res.redirect(mustAuthenticate);
    }

	let body = req.body
        // Additional data validation might also be appropriate
      , signerEmail = validator.escape(body.signerEmail)
      , signerName = validator.escape(body.signerName)
      , envelopeArgs = {
        signerEmail: signerEmail, // represents your {SIGNER_EMAIL}
        signerName: signerName    // represents your {SIGNER_NAME}
    }
  , args = {
        accessToken: req.user.accessToken,  // represents your {ACCESS_TOKEN}
        basePath: req.session.basePath,
        accountId: req.session.accountId,   // represents your {ACCOUNT_ID}
        envelopeArgs: envelopeArgs
    }
      , results = null
      ;

    // Step 2. Construct your API headers
    let dsApiClient = new docusign.ApiClient();
    dsApiClient.setBasePath(args.basePath);
    dsApiClient.addDefaultHeader('Authorization', 'Bearer ' + args.accessToken);

    let envelopesApi = new docusign.EnvelopesApi(dsApiClient)

    // Step 3: Obtain your workflowId
    let accountsApi = new docusign.AccountsApi(dsApiClient)
    let workflowId = null

    try {
        results = await accountsApi.getAccountIdentityVerification(args.accountId);
        workflowId = results.identityVerification[0].workflowId; // represents your {WORKFLOW_ID}
        console.log("WorkflowId: " + workflowId);
    }
    catch (error) {
        let errorBody = error && error.response && error.response.body
            // we can pull the DocuSign error code and message from the response body
            , errorCode = errorBody && errorBody.errorCode
            , errorMessage = errorBody && errorBody.message
            ;
        // In production, may want to provide customized error messages and
        // remediation advice to the user.
        res.render('pages/error', {err: error, errorCode: errorCode, errorMessage: errorMessage});
    }
	// Step 4: Construct your envelope JSON body
	let env = new docusign.EnvelopeDefinition();
    env.emailSubject = 'Please sign';
	env.emailBlurb = 'Sample text for email body';
	env.status = 'Sent';

	//Add a document
	let doc1 = new docusign.Document()
	doc1.DocumentBase64 = '',
    doc1.DocumentId = '1',
    doc1.FileExtension = 'pdf',
    doc1.Name = 'Lorem';

	env.documents = [doc1];

	//Create your signature tab
	let signHere1 = new docusign.SignHere()
    signHere1.Name = 'SignHereTab';
    signHere1.XPosition = '75';
    signHere1.YPosition = '572';
    signHere1.TabLabel = 'SignHereTab';
    signHere1.PageNumber = '1';
    signHere1.DocumentId = '1';
    // A 1- to 8-digit integer or 32-character GUID to match recipient IDs on your own systems.
    // This value is referenced in the Tabs element below to assign tabs on a per-recipient basis.
    RecipientId = '1';  // represents your {RECIPIENT_ID}

	let signer1Tabs = new docusign.Tabs()
	signer1Tabs.signHereTabs = [signHere1];

    let signer1 = docusign.Signer.constructFromObject({
        email: body.signerEmail,
        name: body.signerName,
        recipientId: '1',
        routingOrder: '1',
        deliveryMethod: "Email",
        tabs: signer1Tabs,
        identityVerification: {'workflowId':workflowId, 'steps': null}
    });

    // Add the recipient to the envelope object

    let recipients = docusign.Recipients.constructFromObject({ signers: [signer1]});
	env.recipients = recipients;

    try {
	// Step 5: Send the envelope
    results = await envelopesApi.createEnvelope(args.accountId, {envelopeDefinition: env});
	}
    catch (error) {
        let errorBody = error && error.response && error.response.body
            // we can pull the DocuSign error code and message from the response body
          , errorCode = errorBody && errorBody.errorCode
          , errorMessage = errorBody && errorBody.message
          ;
        // In production, may want to provide customized error messages and
        // remediation advice to the user.
        res.render('pages/error', {err: error, errorCode: errorCode, errorMessage: errorMessage});
    }
        if (results) {
        req.session.envelopeId = results.envelopeId; 	// Save for use by other examples
														// which need an envelopeId
        res.render('pages/example_done', {
            title: "Envelope sent",
            h1: "Envelope sent",
            message: `The envelope has been created and sent!<br/>Envelope ID ${results.envelopeId}.`
        });
    }
}



